let description = "Gitlet is a version control system imitating some basic functionality of Git. Features include checking out old versions of files, merging branches and more. Built with Java.";

const dataGL = {
    name: "gitlet",
  subheading: "Light Version Control System",
  description: description,
  technologies: "Java",
  link: "https://github.com/DevonMartin/Gitlet",
};

export default dataGL;
